import React from 'react'
import './Maintcont.css'
import Im6 from '../../images/6.png';

const Maintcont = ({image, title}) => {
  return (

    <div className="filescont">
        <img src={image} alt="" />
        <span>{title}</span>
    </div>

  )
}

export default Maintcont
